  true,\n\t\"url\": null,\n\t\"notes\": \"Lightning Ridge Technologies, working in
  collaboration with ThenInnovation Laboratory, Inc., extend Automatic Dependent SurveillancenBroadcast
  (ADS-B) into a safe, secure, authenticated system.nHistorically, ADS-B has been
  criticized for its inability to guaranteensafe and secure surveillance in all operational
  conditions.  Thentechnology presented in this proposal provides an integrity check
  on allnADS-B data that is independent of all primary surveillance modes and isn100&amp;#37;
  robust to all GPS spoofing attacks.  An important by-product ofnthat integrity check
  provides us with the further ability to donaircraft-to-aircraft relative positioning
  that is more accurate and morenreliable than any civilian system in existence today.
  \ The ADS-Bnintegrity check and the aircraft-to-aircraft positioning can provide
  anfurther basis on which to enhance the safety of the National AirspacenSystem (NAS).\",\n\t\"license_title\":
